  return (
    <>
      <h1>Please, log in!</h1>

      <label>Email:</label>
      <input
        type="text"
        onChange={(event) => {
          setUser.email(event.target.value);
        }}
      />
      <label>Password:</label>
      <input
        type="password"
        onChange={(event) => {
          setUser.password(event.target.value);
        }}
      />
      <User.Consumer>
      {(fname)=>{
          return <h1>{fname}</h1>
      }}
      </User.Consumer>
      {/* <button onClick={() => login(user)}>Log in</button> */}
    </>
  )
}
